<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="utf-8" />
    <title>Send Message</title>
    <style>
        body {
            font-family: "Inter", Arial, sans-serif;
            background: #0d0d0d;
            color: #e5e5e5;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 40px;
            margin: 0;
        }

        h2 {
            color: #fff;
            margin-bottom: 10px;
            letter-spacing: 0.5px;
        }

        h3 {
            margin-top: 30px;
            color: #bfbfbf;
        }

        p,
        li,
        a {
            color: #cfcfcf;
            font-size: 0.95rem;
        }

        a {
            color: #8aa1ff;
            text-decoration: none;
            transition: color 0.2s ease;
        }

        a:hover {
            color: #b3c3ff;
        }

        form {
            display: flex;
            gap: 10px;
            margin-top: 20px;
            margin-bottom: 20px;
            width: 100%;
            max-width: 400px;
        }

        input[type="text"] {
            flex: 1;
            padding: 10px 14px;
            background: #1a1a1a;
            border: 1px solid #333;
            border-radius: 8px;
            color: #e5e5e5;
            font-size: 1rem;
            transition: all 0.2s ease;
        }

        input[type="text"]:focus {
            border-color: #5563DE;
            box-shadow: 0 0 6px rgba(85, 99, 222, 0.4);
            outline: none;
        }

        button {
            background-color: #5563DE;
            color: white;
            border: none;
            padding: 10px 20px;
            border-radius: 8px;
            font-size: 1rem;
            font-weight: bold;
            cursor: pointer;
            transition: background-color 0.25s ease, transform 0.1s ease;
        }

        button:hover {
            background-color: #3e4bc6;
            transform: translateY(-1px);
        }

        hr {
            border: 0;
            border-top: 1px solid #333;
            margin: 30px 0;
            width: 100%;
            max-width: 400px;
        }

        ul {
            list-style-type: none;
            padding: 0;
            margin: 10px 0 0 0;
        }

        li {
            margin: 6px 0;
            background: #1a1a1a;
            padding: 8px 12px;
            border-radius: 8px;
            border: 1px solid #2b2b2b;
            transition: background 0.2s ease;
        }

        li:hover {
            background: #222;
        }

        .user-info {
            margin-top: 10px;
            margin-bottom: 20px;
            font-size: 0.9rem;
            color: #aaa;
        }
    </style>
</head>

<body>
    {% if session.get('logged_in') %}
    <p class="user-info">
        Logged in as <strong>{{ session.get('user') }}</strong>.
        <a href="{{ url_for('logout') }}">Logout</a> |
        <a href="{{ url_for('dashboard', user=session.get('user')) }}">Dashboard</a>
    </p>
    {% else %}
    <h1><a href="{{ url_for('login') }}">Login</a></h1>
    {% endif %}
